import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { supabase } from '../supabaseClient';

const Navbar = ({ cartCount, openModal, user }) => {
  const navigate = useNavigate();

  return (
    <header style={{ fontFamily: 'Arial, sans-serif' }}>
      {/* Top Main Bar */}
      <div style={topBarStyle}>
        <Link to="/" style={logoStyle}><span>.rw</span></Link>
        
        <div style={locationBox}>
          <span style={{ fontSize: '12px', opacity: 0.8 }}>Deliver to</span>
          <div style={{ fontWeight: 'bold' }}>Rwanda</div>
        </div>

        <div style={searchContainer}>
          <select style={searchSelect}><option>All</option></select>
          <input type="text" placeholder="Search Amazon" style={searchInput} />
          <button style={searchButton}>üîç</button>
        </div>

        <div style={navItems}>
          <Link to="/login" style={linkItem}>
            <span style={smallText}>Hello, {user ? user.email.split('@')[0] : 'sign in'}</span>
            <div style={boldText}>Account & Lists</div>
          </Link>
          <Link to="/profile" style={linkItem}>
            <span style={smallText}>Returns</span>
            <div style={boldText}>& Orders</div>
          </Link>
          <div onClick={openModal} style={cartStyle}>
            <span style={{ fontSize: '24px' }}>üõí</span>
            <span style={cartCountStyle}>{cartCount}</span>
            <span style={boldText}>Cart</span>
          </div>
        </div>
      </div>

      {/* Secondary Sub-Bar */}
      <div style={subBarStyle}>
        <div style={{ fontWeight: 'bold', display: 'flex', alignItems: 'center', gap: '5px', cursor: 'pointer' }}>
          <span>‚ò∞</span> All
        </div>
        <span>Today's Deals</span>
        <span>Customer Service</span>
        <span>Registry</span>
        <span>Gift Cards</span>
        <span>Sell</span>
      </div>
    </header>
  );
};

// --- Amazon Colors & Styles ---
const topBarStyle = { backgroundColor: '#131921', color: 'white', padding: '10px 20px', display: 'flex', alignItems: 'center', gap: '20px' };
const logoStyle = { color: 'white', textDecoration: 'none', fontSize: '24px', fontWeight: 'bold' };
const locationBox = { fontSize: '14px', cursor: 'pointer' };
const searchContainer = { flex: 1, display: 'flex', height: '40px' };
const searchSelect = { backgroundColor: '#f3f3f3', border: 'none', padding: '0 10px', borderRadius: '4px 0 0 4px', borderRight: '1px solid #ddd' };
const searchInput = { flex: 1, border: 'none', padding: '0 10px', outline: 'none' };
const searchButton = { backgroundColor: '#febd69', border: 'none', width: '45px', borderRadius: '0 4px 4px 0', cursor: 'pointer' };
const navItems = { display: 'flex', gap: '20px', alignItems: 'center' };
const linkItem = { color: 'white', textDecoration: 'none', display: 'flex', flexDirection: 'column' };
const smallText = { fontSize: '12px' };
const boldText = { fontSize: '14px', fontWeight: 'bold' };
const cartStyle = { display: 'flex', alignItems: 'center', position: 'relative', cursor: 'pointer' };
const cartCountStyle = { position: 'absolute', top: '-5px', left: '12px', color: '#f08804', fontWeight: 'bold' };
const subBarStyle = { backgroundColor: '#232f3e', color: 'white', padding: '8px 20px', display: 'flex', gap: '15px', fontSize: '14px' };

export default Navbar;
